docs/contributing/HotModuleReplacement.h.body:
One of our favorite features of GlueStick is hot module replacement, an awesome feature that allows for updates to show without refreshing the browser. To start, open src/components/Home.js in your favorite editor, and replace the word “Home” with “Hello World!”. Make sure the web browser is visible when you do this. and you will see that “Home” will magically change to “Hello World!” right before your very eyes…without even having to refresh the browser.You’re going to work on styling next, so let’s discuss our styling tool: Radium. (We won’t go into all of the details as to why Radium is so amazing; the Radium docs do a good enough job of that.) GlueStick projects have Radium in-built for you so all its awesomeness is there for your use.Follow these four simple steps to use Radium with your component.Import Radium

import Radium from "radium"
Decorate your class using the Radium decorator

@Radium
export default class Home extends Component {
Define your styles in an object.

const styles = {
    header: {
        color: "green"
    }
};
Apply the style to an element

Hello World!
So your entire component should now look like this:import React, { Component, PropTypes } from "react";
import Radium from "radium";

@Radium
export default class Home extends Component {
    render () {
        return (

                Hello World!

        );
    }
}

const styles = {
    header: {
        color: "green"
    }
};

Immediately after you save the file, “Hello World!” will turn green—no refresh needed. The ability to quickly iterate over styles without refreshing the browser is a huge time saver and results in a boost in productivity. Thanks to the array of open source tools we use under the hood with GlueStick, this kind of flow was relatively easy to build and is very helpful.

docs/contributing/GeneratingContainer.ht.body:
GlueStick includes several generators to help boost productivity even further. Given its role in the application development, you will start with the Container generator. GlueStick apps use Redux for managing application-state. When using Redux, components that are directly connected to Redux are referred to as “containers.” These will generally be components that we connect to a route in our router. Now that the essentials are in place, we’re going to walk you through the creation of an actual application. For this guide, you will build a todo list application. (After all, we ARE trying to boost productivity.) Your first step will be generating a container for your todo list. gluestick generate container Todos This will generate the following file:src/containers/Todos.jsimport React, { Component, PropTypes } from "react";
import { bindActionCreators } from "redux";
import { connect } from "react-redux";

@connect(
    (state) => ({/** _INSERT_STATE_  **/}),
    (dispatch) => bindActionCreators({/** _INSERT_ACTION_CREATORS_ **/}, dispatch)
)
export default class Todos extends Component {
    static fetchData ({dispatch}) {}

    render () {
        return (
            Todos
        );
    }
}
As you can see, this is a simple component that is already hooked up to the Redux store for you. Notice the static method, fetchData, gives you a hook whereby you can asynchronously fetch data before your container is rendered. Your server-side request won’t respond until all of the data is filled in so that you don’t end up returning to your app’s loading state for every thing. To match this container to a route, we will need to add an entry to the routes file. If you have used React Router, then the routes file will look familiar to you, since we built this in to GlueStick already. However, we have already hooked up the router for you so that you don’t have to mess with it and can just focus on defining your routes.The routes file is located at src/config/routes.js and it looks like this:import React from "react";
import { Route, IndexRoute } from "react-router";

import MasterLayout from "../components/MasterLayout";
import HomeApp from "../containers/HomeApp";

export default (



);
Matching your newly created Todos container with a route is simple. First, import your container, then add a nested route with the correct path and component.import React from "react";
import { Route, IndexRoute } from "react-router";

import MasterLayout from "../components/MasterLayout";
import HomeApp from "../containers/HomeApp";
import Todos from "../containers/Todos";

export default (




);
Now direct your browser to http://localhost:8888/todos and your new container should show up.

