Redux sends actions to the reducers through a dispatch method that is provided for you through the @connect decorator that GlueStick automatically sets up for you. Redux gives you the ability to bind your action creators to the dispatcher with its bindActionCreators method. GlueStick also sets most of this up for you so that you only need to pass your action creators in the place where the code says `/** _INSERT_ACTION_CREATORS_ **/.Update your Todos container so that you can pass your bound addTodo action creator to the AddTodo component.
